import static org.mockito.Mockito.*;
import static org.mockito.ArgumentMatchers.*;
import org.springframework.data.domain.Page;
import org.springframework.data.domain.PageRequest;
import org.springframework.data.domain.Pageable;
import org.springframework.web.bind.WebDataBinder;
import org.springframework.samples.petclinic.owner.Owner;
import org.springframework.samples.petclinic.owner.OwnerRepository;

@ExtendWith(MockitoExtension.class)
class OwnerControllerTest {

	@Mock
	private OwnerRepository owners;

	@InjectMocks
	private OwnerController controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Verifies that setDisallowedFields is called with 'id' on the provided WebDataBinder")
	void testSetAllowedFieldsHappyPath() {
		controller.setAllowedFields(new WebDataBinder(new Object(), "test"));
	}

	@Test
	@DisplayName("Verifies that passing null as dataBinder throws NullPointerException")
	void testSetAllowedFieldsNullInput() {
		assertThrows(NullPointerException.class, () -> {
			controller.setAllowedFields(null);
		});
	}

	@Test
	@DisplayName("Verifies that the method works even if the dataBinder already has disallowed fields set initially")
	void testSetAllowedFieldsWithExistingDisallowedFields() {
		WebDataBinder dataBinder = new WebDataBinder(new Object(), "test");
		dataBinder.setDisallowedFields("existingField");
		controller.setAllowedFields(dataBinder);
	}

	@Test
	@DisplayName("Returns the owner when a valid ownerId is provided and the owner exists")
	void testFindOwnerWithValidId() {
		Owner mockOwner = new Owner();
		when(owners.findById(1)).thenReturn(Optional.of(mockOwner));
		var result = controller.findOwner(1);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Throws IllegalArgumentException when ownerId is provided but no owner is found")
	void testFindOwnerWithInvalidId() {
		when(owners.findById(999)).thenReturn(Optional.empty());
		assertThrows(IllegalArgumentException.class, () -> {
			controller.findOwner(999);
		});
	}

}

